import React, { useState, useRef, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Search, X, Bell, User, Calendar, UserPlus, ChevronDown, Users, Globe, Lock } from 'lucide-react';
import { useTheme } from '../styles/ThemeContext';
import menuConfig from '../Config/MenuConfig.json';
import SearchInput from '../components/SearchInput';

const HomePage = () => {
  const [destination, setDestination] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [showFriendsDropdown, setShowFriendsDropdown] = useState(false);
  const [selectedFriendOption, setSelectedFriendOption] = useState(menuConfig.friendsOptions[0]);
  const dropdownRef = useRef(null);
  const { darkMode } = useTheme();
  const navigate = useNavigate();
  const [selectedDestination, setSelectedDestination] = useState('');
  const [error, setError] = useState('');


  const iconComponents = {
    Users: Users,
    Globe: Globe,
    Lock: Lock
  };

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setShowFriendsDropdown(false);
      }
    };


    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  const handleDestinationSelect = (destination) => {
    setSelectedDestination(destination.name);
    setError('');
  };

  const generatePlanId = () => {
    return Math.random().toString(36).substring(2, 15) + Math.random().toString(36).substring(2, 15);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!selectedDestination) {
      setError('Choose a destination to start planning');
      return;
    }
    const planId = generatePlanId();
    const planData = {
      destination: selectedDestination,
      startDate,
      endDate
    };
    navigate(`/plan/${planId}`, { state: planData });
  };

  return (
    <div className={`tinoto-container ${darkMode ? 'dark-mode' : ''}`}>
      <h1 className="tinoto-main-title">Plan a new trip</h1>
      <form onSubmit={handleSubmit} className="tinoto-form">
        <div className="tinoto-form-group">
          <label htmlFor="destination" className="tinoto-label">Where to?</label>
          <SearchInput 
            id="destination"
            placeholder="e.g. Paris, Hawaii, Japan" 
            onSelect={handleDestinationSelect}
            value={selectedDestination}
          />
          {error && <p className="tinoto-error">{error}</p>}
        </div>

        <div className="tinoto-form-group">
          <label className="tinoto-label">Dates (optional)</label>
          <div className="tinoto-date-inputs">
            <div className="tinoto-date-input">
              <Calendar size={18} />
              <input 
                type="date" 
                placeholder="Start date" 
                value={startDate}
                onChange={(e) => setStartDate(e.target.value)}
              />
            </div>
            <div className="tinoto-date-input">
              <Calendar size={18} />
              <input 
                type="date" 
                placeholder="End date" 
                value={endDate}
                onChange={(e) => setEndDate(e.target.value)}
              />
            </div>
          </div>
        </div>

        <div className="tinoto-form-group tinoto-flex tinoto-justify-between tinoto-items-center">
          <button type="button" className="tinoto-button-secondary">
            <UserPlus size={18} />
            Invite tripmates
          </button>
          <div className="tinoto-dropdown">
            <button type="button" className="tinoto-button-dropdown">
              Friends
              <ChevronDown size={18} />
            </button>
          </div>
        </div>

        <div className="tinoto-form-group tinoto-text-center">
          <button type="submit" className="tinoto-button-primary">Start planning</button>
        </div>
      </form>
      <p className="tinoto-text-center">
        Or <Link to="/write-guide" className="tinoto-link">write a new guide</Link>
      </p>
    </div>

  );
};

export default HomePage;
